'use strict';

/*
* When adding modules to the namespace, ensure that they are added in alphabetical order according to module name.
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );


// MAIN //

/**
* Top-level namespace.
*
* @namespace ns
*/
var ns = {};

/**
* @name anyIter
* @memberof ns
* @readonly
* @type {Function}
* @see {@link module:@stdlib/utils/iterators/any}
*/
setReadOnly( ns, 'anyIter', require( '@stdlib/utils/iterators/any' ) );

/**
* @name everyIter
* @memberof ns
* @readonly
* @type {Function}
* @see {@link module:@stdlib/utils/iterators/every}
*/
setReadOnly( ns, 'everyIter', require( '@stdlib/utils/iterators/every' ) );

/**
* @name forEachIter
* @memberof ns
* @readonly
* @type {Function}
* @see {@link module:@stdlib/utils/iterators/for-each}
*/
setReadOnly( ns, 'forEachIter', require( '@stdlib/utils/iterators/for-each' ) );

/**
* @name mapIter
* @memberof ns
* @readonly
* @type {Function}
* @see {@link module:@stdlib/utils/iterators/map}
*/
setReadOnly( ns, 'mapIter', require( '@stdlib/utils/iterators/map' ) );

/**
* @name noneIter
* @memberof ns
* @readonly
* @type {Function}
* @see {@link module:@stdlib/utils/iterators/none}
*/
setReadOnly( ns, 'noneIter', require( '@stdlib/utils/iterators/none' ) );

/**
* @name someIter
* @memberof ns
* @readonly
* @type {Function}
* @see {@link module:@stdlib/utils/iterators/some}
*/
setReadOnly( ns, 'someIter', require( '@stdlib/utils/iterators/some' ) );


// EXPORTS //

module.exports = ns;
